use std::cmp::max;
use std::collections::HashMap;

// 1 <= nums.length <= 105
// nums[i] 不是 0 就是 1
pub fn find_max_length(nums: Vec<i32>) -> i32 {
    let mut count = 0;
    let mut cur = 0;
    let mut map:HashMap<i32, i32> = HashMap::new();
    map.insert(0, -1);
    for (i, num) in nums.iter().enumerate() {
        match num {
            0 => cur -= 1,
            1 => cur += 1,
            _ => {}
        }
        if map.contains_key(&cur) {
            count = max(count, i as i32 - map[&cur])
        } else {
            map.insert(cur, i as i32);
        }
    }
    count as i32
}

#[test]
fn find_max_length_test0() {
    let nums = vec![0,1];
    assert_eq!(2, find_max_length(nums));
}

#[test]
fn find_max_length_test1() {
    let nums = vec![0,1,0];
    assert_eq!(2, find_max_length(nums));
}

